import React from 'react'

const Footer = () => {
    const styles = {
        footer:{
            display:'flex',
            color:'#ECECEC',
            flexDirection:'row',
            justifyContent:'space-around'
        }
    }
  return (
    <div style={styles.footer}>
        <div>ABC</div>
        <div>DEF</div>
        <div>GHI</div>
        <div>JKL</div>
    </div>
  )
}




export default Footer
